INSERT INTO `episode` (`EpisodeID`, `SeasonID`, `EpisodeNo`, `EpisodeTitle`, `Summary`, `Duration`, `AiringDate`) VALUES
(700000, 400000, 1, 'Pilot', 'Diagnosed with terminal lung cancer, a high school chemistry teacher resorts to cooking and selling methamphetamine to provide for his family.', 58, '2008-01-20'),
(700001, 400001, 1, 'Seven Thirty-Seven', 'As they lay plans for theris final big drug deals, Walt and Jesse worry that their sole buyer will think nothing of killing them when it suits him.', 47, '2009-05-08'),
(700002, 400002, 1, 'No MÃ¡s', 'Skyler forces Walt to move out in the wake of the airline disaster, while Jesse\'s rehab helps him come to grips with his role in the collision.', 47, '2010-03-21'),
(700003, 400003, 1, 'The Tagger', 'Jake is assigned a lowly graffiti case as punishment for being late to roll call.', 21, '2013-09-17'),
(700004, 400004, 1, 'Undercover', 'When Jake discovers that a monbster escaped his otherwise successful sting, he enlists Charles to help track him down, which worries Gina.', 21, '2014-09-28'),
(700007, 400007, 1, 'Mo Money Mo Problems', 'Beth and Annie reveal a major change of plans to Ruby as one dangerous rival\'s threats redefine the rules of the heist.', 41, '2018-02-26'),
(700008, 400008, 1, 'I\'d Rather Be Crafting', 'Beth grapples with Rio\'s unnerving ask. Elsewhere, Ruby and Stan reach a new low, and Annie and Gregg navigate a new nt-so-normal.', 42, '2020-01-01'),
(700013, 400013, 1, 'Episode 1', 'In 1977, frustrated FBI hostage negotiator Holden Forn finds an unlikely ally in veteran agent Bill Tench and begins studying a new class of murderer.', 42, '2017-10-13'),
(700014, 400014, 1, 'Episode 2', 'To glean insight into the elusive BTK killer, Bill and Holden interview the Son of sam, who makes a startling admission.', 46, '2019-08-16'),
(700017, 400017, 1, 'Chapter 1: The Vanishing of Will Byers', 'On his way home from a friend\'s house, young Will sees something terrifying. Nearby, a sinister secret lurks in the depths of a government lab.', 48, '2016-07-15'),
(700018, 400018, 1, 'Chapter 1: MADMAX', 'As the town preps for Halloween, a high-scoring rival shakes things up at the arcade, and a skeptical Hopper inspects a field of rotting pumpkins.', 48, '2017-10-27'),
(700021, 400021, 1, 'Run Boy Run', 'After sharing the story of his time travel with Vanya, Five hunts for the owner of a fake eye. But two mysterious assassins are hot on his trail.', 58, '2019-02-15'),
(700022, 400022, 1, 'The Swedish Job', 'As the sit-in approaches, Allison reconnects with Klaus, the Swedes chase Vanya into a cornfield, and Luther makes a distressing discovery.', 48, '2020-07-31'),
(700023, 400000, 2, 'Cat\'s in the Bag...', 'After their first drug deal goes terribly wrong, Walt and Jesse are forced to deal with a corpse and a prisoner. Meanwhile, Skyler grows suspicious of Walt\'s activities.', 48, '2008-01-27'),
(700025, 400000, 3, '...And the Bag\'s in the River', 'Walt and Jesse clean up after the bathtub incident before Walt decides what course of action to take with their prisoner Krazy-8.', 48, '2008-02-10'),
(700026, 400000, 4, 'Cancer Man', 'Walt tells the rest of his family about his cancer. Jesse tries to make amends with his own parents.', 48, '2008-02-17'),
(700027, 400000, 5, 'Gray Matter', 'Skyler organizes an intervention to persuade Walt to accept his former research partner\'s generous offer to pay for the cancer treatments.', 48, '2008-02-24'),
(700028, 400000, 6, 'Crazy Handful of Nothin\'', 'With the side effects and cost of his treatment mounting, Walt demands that Jesse find a wholesaler to buy their drugs -- which lands him in trouble.', 48, '2008-03-02'),
(700029, 400000, 7, 'A No-Rough-Stuff-Type Deal', 'After Jesse\'s brush with death, Walt agrees to produce even more drugs for the ruthless Tuco. Meanwhile, Skyler suspects her sister of shoplifting.', 48, '2008-03-09'),
(700031, 400001, 2, 'Grilled', 'As a DEA manhunt for Tuco gets under way, Skyler enlists Hank in the search for Walt.', 47, '2009-03-15'),
(700032, 400001, 3, 'Bit by a Dead Bee', 'As Hank comes dangerously close to uncovering Walt\'s role in the drug trade, he devises a plan to cover his tracks.', 47, '2009-03-22'),
(700033, 400001, 4, 'Down', 'With Walt struggling to bridge the growing gulf between him and Skyler, Jesse finds himself without a home after his parents evict him.', 48, '2009-03-29'),
(700034, 400001, 5, 'Breakage', 'Hank tries to pull himself together after his encounter with Tuco. Meanwhile, Jesse assembles a crew to get more product on the street.', 48, '2009-04-05'),
(700035, 400001, 6, 'Peekaboo', 'As Jesse pursues the addicts who stole Skinny Pete\'s drug supply, Walt devises a cover story to explain how he\'s been paying for his treatments.', 48, '2009-04-12'),
(700036, 400001, 7, 'Negro y Azul', 'As Jesse\'s reputation as a drug lord leads Walt to push for expansion of the operation, Hank\'s foray into the DEA\'s El Paso office leaves him shaken.', 48, '2009-04-19'),
(700037, 400001, 8, 'Better Call Saul', 'Badger\'s arrest forces Walt and Jesse into league with a shady lawyer.', 48, '2009-04-26'),
(700038, 400001, 9, '4 Days Out', 'Worried that he doesn\'t have much longer to live, Walt looks to provide for his family by enlisting Jesse for a marathon meth-cooking session.', 48, '2009-05-03'),
(700039, 400001, 10, 'Over', 'In the wake of good news about his cancer treatments, Walt turns on his brother-in-law before focusing his attention on making things right at home.', 48, '2009-05-10'),
(700040, 400001, 11, 'Mandala', 'As the end of her pregnancy finds Skyler conflicted about her feelings, a dealer\'s death forces Walt to look for somewhere to unload a load of meth.', 48, '2009-05-17'),
(700041, 400001, 12, 'Phoenix', 'After missing his daughter\'s birth to complete a big drug deal, Walt squares off with Jesse\'s girlfriend over his share of the cash.', 48, '2009-05-24'),
(700042, 400001, 13, 'ABQ', 'Walt tries to put his and Jesse\'s lives back on track as he prepares for surgery and looks to keep his money source a secret from Skyler and Walt Jr.', 48, '2009-05-31'),
(700043, 400002, 2, 'Caballo Sin Nombre', 'With Skyler set on divorce, an unwitting Walt lands squarely in the crosshairs of two Mexican drug cartel hit men who are looking for revenge.', 48, '2011-07-24'),
(700044, 400002, 3, ' I.F.T.', 'The tension mounts as Walt calls Skyler\'s bluff and moves back home without her consent, and Jesse ponders re-entering the drug trade.', 47, '2011-07-31'),
(700045, 400002, 4, 'Green Light', 'Walt gets involved when a new batch of meth puts Jesse back in business. Meanwhile, Skyler\'s affair with her boss is creating chaos.', 48, '2011-08-07'),
(700046, 400002, 5, 'Mas', 'As Skyler reconsiders her objections to Walt\'s return, he mulls over returning to the drug trade. Also, Hank\'s obsession promises trouble for Jesse.', 48, '2011-08-14'),
(700047, 400002, 6, 'Sunset', 'The discovery of Walt and Jesse\'s old RV forces them to act fast just as Walt resumes business in Gus\'s state-of-the-art meth lab.', 48, '2011-08-21'),
(700048, 400002, 7, 'One Minute', 'When Hank risks his career by attacking Jesse, Jesse vows to retaliate with a lawsuit, and Skyler looks to Walt to stop Jesse from pressing charges.', 48, '2011-08-28'),
(700049, 400002, 8, 'I See You', 'With Hank clinging to life after surviving the drug cartel\'s attack, Walt looks to ward off trouble by taking on Jesse as a partner.', 47, '2011-09-04'),
(700050, 400002, 9, 'Kafkaesque', 'While the prospects for Hank\'s recovery place Marie at odds with their insurance company, Jesse looks for a way to increase his take.', 48, '2011-09-11'),
(700051, 400002, 10, 'Fly', 'A long, tense night in the meth lab pits Walt and Jesse against a pesky fly that refuses to die, no matter what they do.', 48, '2011-09-18'),
(700052, 400002, 11, 'Abiquiu', 'Hank is unhappy with the pace of his recovery, Skyler questions Saul\'s money-laundering scheme, and Jesse falls for a fellow rehab patient.', 48, '2011-09-25'),
(700053, 400002, 12, 'Half Measures', 'Jesse pursues the dealers who orchestrated Combo\'s murder, Hank refuses to leave the hospital, and Skyler presses Walt to accept her scheme.', 47, '2011-10-02'),
(700054, 400002, 13, 'Full Measure', 'After taking out two of his boss\'s street dealers, Walt realizes that Gus is planning to kill him and Jesse and replace him with his former assistant.', 48, '2011-10-09'),
(700055, 400003, 2, 'The Tagger', 'When tightly wound Capt. Holt takes over the precinct, carefree Det. Jake Peralta and his dysfunctional coworkers\' lives get demanding.', 22, '2013-09-24'),
(700056, 400003, 3, 'The Slump', 'Jake\'s unsolved cases pile up and the other detectives fear that his losing streak will rub off on them, while Amy must run an at-risk youth program.', 22, '2013-10-01'),
(700057, 400003, 4, 'M.E. Time', 'The team turns on Jake for delaying an autopsy report by flirting with an attractive medical examiner, who turns out to be more than he bargained for.', 22, '2013-10-08'),
(700058, 400003, 5, 'The Vulture', 'A Major Crimes detective known as \"The Vulture\" takes over Jake\'s nearly solved case and steals his thunder, prompting revenge.', 22, '2013-10-13'),
(700059, 400003, 6, 'Halloween', 'Halloween-hating Amy is anything but festive when she has to don a costume and hit the streets with Charles on busy Halloween night', 22, '2013-10-22'),
(700060, 400003, 7, '48 Hours', 'After making an arrest with too little proof, Jake has 48 hours to get evidence or the perp will go free, forcing the team to work over the weekend.', 22, '2013-11-05'),
(700061, 400003, 8, 'Old School', 'Jake\'s dream day with his hero, a former crime reporter, turns nightmarish when his comments about Holt and the precinct go \"on the record.\"', 22, '2013-11-12'),
(700062, 400003, 9, 'Sal\'s Pizza', 'When Jake\'s favorite pizzeria is burned down and the fire marshal suspects the owner, Jake steps outside his jurisdiction to catch the real arsonist.', 22, '2013-11-19'),
(700063, 400003, 10, 'Thanksgiving', 'Amy hosts Thanksgiving dinner for the precinct in an effort to get Holt to be her mentor, but Holt and Jake leave early and the rest hate her cooking.', 22, '2013-11-26'),
(700064, 400003, 11, 'Christmas', 'When Capt. Holt receives death threats, Jake is placed on his protective detail and revels in the chance to boss his boss around.', 22, '2013-12-03'),
(700065, 400003, 12, 'Pontiac Bandit', 'Jake and Rosa hunt an infamous car thief, Holt tries to find a home for puppies and the rest of the precinct tries to accommodate a wounded Charles.', 22, '2014-01-07'),
(700066, 400003, 13, 'The Bet', 'After Jake and Amy\'s bet about who can make more arrests is finally settled, the two go on a stakeout where Jake reevaluates their relationship.', 22, '2014-01-14'),
(700067, 400003, 14, 'The Ebony Falcon', 'On his first task back in the field, Terry takes advice from Jake on controlling his emotions to infiltrate and bust a steroid trafficking ring.', 22, '2014-01-21'),
(700068, 400003, 15, 'Operation: Broken Feather', 'While investigating a string of hotel robberies together, Jake discovers that Amy may transfer to the Major Crimes unit and work with \"The Vulture.\"', 22, '2014-02-02'),
(700069, 400003, 16, 'The Party', 'At Capt. Holt\'s birthday party, Jake, Amy and the other officers try to make a good impression on Holt\'s husband but fail miserably.', 21, '2014-02-04'),
(700070, 400003, 17, 'Full Boyle', 'To stop Detective Boyle from getting too clingy, or \"Full Boyle,\" with his new girlfriend, Jake goes on their date, but things don\'t go as planned.', 22, '2014-02-11'),
(700071, 400003, 18, 'The Apartment', 'When Jake\'s building goes co-op and he must pay nearly a half million dollars to keep his apartment, he desperately seeks Gina\'s help.', 22, '2014-02-25'),
(700072, 400003, 19, 'Tactical Village', 'At Tactical Village, where the precinct competes against other precincts in paintball exercises, Jake gets jealous when Amy runs into an old flame.', 22, '2014-03-04'),
(700073, 400004, 2, 'Chocolate Milk', 'Holt\'s nemesis heads the precinct inspection, while Terry readies for his vasectomy and Charles needs a date for his ex-wife\'s engagement party.', 22, '2014-10-05'),
(700074, 400004, 3, 'The Jimmy Jab Games', 'When a motorcade detail is delayed, it leads to a wacky competition, and Charles must get an incriminating videotape from Hitchcock.', 22, '2014-10-12'),
(700075, 400004, 4, 'Halloween II', 'For their annual Halloween wager, Jake bets Holt that he can steal his watch before midnight, and Gina gets kicked off her dance squad, Floorgasm.', 22, '2014-10-19'),
(700076, 400004, 5, 'The Mole', 'Holt and Jake search for a mole in the precinct, and Terry and Rosa visit a silent disco to find \"Giggle Pig\" dealers.', 22, '2014-11-02'),
(700077, 400007, 1, 'Pilot', 'As Beth, Ruby and Annie face personal and financial crises, they decide to team up and take back their lives -- by robbing their local grocery store.', 45, '2018-02-26'),
(700078, 400007, 3, 'Borderline', 'The ladies acquire a getaway car and hit the road for a mysterious mission. Annie and Sadie prepare for a crucial meeting.', 43, '2018-03-12'),
(700079, 400007, 4, 'Atom Bomb', 'Beth finds a shocking surprise in her daughterâs room, Ruby deals with a difficult customer at work, and Annie helps Sadie with a heartbreaking issue.', 43, '2018-03-19'),
(700080, 400007, 5, 'Taking Care of Business', 'After an unexpected visitor drops by, Beth encourages the group to rethink their new deal. Annie makes an impulsive decision and a critical mistake.', 42, '2018-03-26'),
(700081, 400008, 2, 'Slow Down, Children at Play', 'As Rio raises the stakes with a critical job, Mary Pat struggles with her ties to Boomer, and Annie shares an awkward evening with Nancy.', 43, '2019-03-10'),
(700082, 400008, 3, 'You Have Reached the Voicemail of Leslie Peterson', 'Things go awry when the ladies recruit Mary Pat for a pressing mission. Meanwhile, Beth receives surprising news about Kenny.', 42, '2019-03-17'),
(700083, 400008, 4, 'Pick Your Poison', 'Beth, Ruby and Annie deal with the demands of Rioâs \"kingdom.\" As the drama evolves, Annie takes a closer look at Boomerâs cruelest scheme.\r\n\r\n', 43, '2019-03-24'),
(700084, 400008, 5, 'Everything Must Go', 'An inside threat pushes the ladies toward a desperate alliance. Annie uncovers a pivotal secret. Beth and Dean make a domestic deal.', 42, '2019-03-31'),
(700085, 400013, 2, 'Episode 2', 'Holden interviews the eerily articulate murderer Ed Kemper, but his research provokes negative feedback at the Bureau.', 56, '2017-10-13'),
(700086, 400013, 3, 'Episode 3', 'Dr. Wendy Carr joins Holden and Tench in their first success, when their insights lead to an arrest.', 46, '2017-10-13'),
(700087, 400013, 4, 'Episode 4', 'Bill and Holden consult with Dr. Wendy Carr to begin classifying their subjects. They receive surprising news.', 54, '2017-10-13'),
(700088, 400013, 5, 'Episode 5', 'Holden and Bill return to a perplexing case in Pennsylvania where a set of clues leading in multiple directions leaves no shortage of suspects.', 42, '2017-10-13'),
(700089, 400014, 1, 'Episode 1', 'Amid sweeping changes at the BSU, Holden deals with severe repercussions from his close encounter with Ed Kemper.', 49, '2019-08-16'),
(700090, 400014, 3, 'Episode 3', 'Bill gets drawn into a horrifying crime that hits close to home. Holden receives an intriguing offer while in Atlanta to interview a pair of killers.', 61, '2019-08-16'),
(700091, 400014, 4, 'Episode 4', 'Holden develops a controversial profile in the Atlanta slayings. Wendy conducts her first interview and finds being on the front lines suits her well.', 51, '2019-08-16'),
(700092, 400014, 5, 'Episode 5', 'Bill\'s devastating family situation spills over during his interview with Holden\'s holy-grail subject: Charles Manson. Wendy\'s new romance heats up.', 72, '2019-08-16'),
(700093, 400017, 2, 'Chapter Two: The Weirdo on Maple Street', 'Lucas, Mike and Dustin try to talk to the girl they found in the woods. Hopper questions an anxious Joyce about an unsettling phone call.', 56, '2016-07-15'),
(700094, 400017, 3, 'Chapter Three: Holly, Jolly', 'An increasingly concerned Nancy looks for Barb and finds out what Jonathan\'s been up to. Joyce is convinced Will is trying to talk to her.', 52, '2016-07-15'),
(700095, 400017, 4, 'Chapter Four: The Body', 'Refusing to believe Will is dead, Joyce tries to connect with her son. The boys give Eleven a makeover. Nancy and Jonathan form an unlikely alliance.', 51, '2016-07-15'),
(700096, 400017, 5, 'Chapter Five: The Flea and the Acrobat', 'Hopper breaks into the lab while Nancy and Jonathan confront the force that took Will. The boys ask Mr. Clarke how to travel to another dimension.', 53, '2016-07-15'),
(700097, 400018, 2, 'Chapter Two: Trick or Treat, Freak', 'After Will sees something terrible on trick-or-treat night, Mike wonders whether Eleven\'s still out there. Nancy wrestles with the truth about Barb.', 56, '2017-10-27'),
(700098, 400018, 3, 'Chapter Three: The Pollywog', 'Dustin adopts a strange new pet, and Eleven grows increasingly impatient. A well-meaning Bob urges Will to stand up to his fears.', 51, '2017-10-27'),
(700099, 400018, 4, 'Chapter Four: Will the Wise', 'An ailing Will opens up to Joyce -- with disturbing results. While Hopper digs for the truth, Eleven unearths a surprising discovery.', 46, '2017-10-27'),
(700100, 400018, 5, 'Chapter Five: Dig Dug', 'Nancy and Jonathan swap conspiracy theories with a new ally as Eleven searches for someone from her past. âBob the Brainâ tackles a difficult problem.', 58, '2017-10-27'),
(700101, 400022, 1, 'Right Back Where We Started', 'After dropping his siblings into an alley in Dallas â in different years â Five scrambles to track them all down and stop a new doomsday threat.', 47, '2020-07-31'),
(700102, 400022, 2, 'The Frankel Footage', 'An incident at the bar leads Luther to Vanya. Five finds an unsettling surprise in the film Hazel left behind. The cops come after Allison\'s husband.', 48, '2020-07-31'),
(700103, 400022, 4, 'The Majestic 12', 'While Allison searches frantically for Ray, Vanya contends with a crisis at the farm, and Five, Diego and Lila crash a party at the Mexican Consulate.', 49, '2020-07-31'),
(700104, 400022, 5, 'Valhalla', 'Summoned to an emergency meeting, the siblings hatch very different plans for how to spend their last six days on Earth. Lila confronts her mother.', 48, '2020-07-31'),
(700105, 400021, 1, ' We Only See Each Other at Weddings and Funerals', 'Years after they rose to fame as young crime-fighting superheroes, the estranged Hargreeves siblings come together to mark their father\'s death.', 60, '2019-02-15'),
(700106, 400021, 3, ' Extra Ordinary', 'Worried their mother is hiding something, Luther and Allison call a family meeting. Cha-Cha and Hazel catch a big break in their hunt for Five.', 57, '2019-02-15'),
(700107, 400021, 4, 'Man on the Moon', 'The story of Luther\'s transformation emerges. At the motel, Klaus puts Hazel and Cha-Cha\'s training to the test. Allison grows suspicious of Leonard.', 57, '2019-02-15'),
(700108, 400021, 5, 'Number Five', 'Five lets Luther in on his secret, Klaus returns from a harrowing trip through time, and Vanya begins to feel different without her meds.', 61, '2019-02-15');
